package org.apache.commons.dbutils;

import static org.junit.jupiter.api.Assertions.assertTrue;
import static org.mockito.Mockito.doThrow;
import static org.mockito.Mockito.mock;

import java.io.ByteArrayOutputStream;
import java.io.PrintStream;
import java.sql.Connection;
import java.sql.SQLException;

import org.junit.jupiter.api.DisplayName;
import org.junit.jupiter.api.Test;

public class ErrorHandlingTest {

    @Test
    @DisplayName("Tests that the DbUtils system correctly handles and reports data access errors to stderr")
    void testDataAccessErrorHandlingAndReporting() throws SQLException {
        // Setup: Redirect System.err to capture its output
        ByteArrayOutputStream errContent = new ByteArrayOutputStream();
        PrintStream originalErr = System.err;
        System.setErr(new PrintStream(errContent));

        Connection mockConnection = null;
        try {
            // Create a mock Connection that throws a SQLException when its close() method is called
            mockConnection = mock(Connection.class);
            doThrow(new SQLException("Simulated connection close error for diagnostic reporting")).when(mockConnection).close();

            // Call DbUtils.closeQuietly which is expected to catch the SQLException and print it to System.err
            DbUtils.closeQuietly(mockConnection);

            // Capture the output and verify that the diagnostic information was printed
            String errorMessage = errContent.toString();

            // Assert that the error message contains the specific SQLException message
            assertTrue(errorMessage.contains("SQLException: Simulated connection close error for diagnostic reporting"),
                "System.err output should contain the message of the simulated SQLException.");

            // Assert that the error message contains context from DbUtils.closeQuietly, indicating it was handled
            assertTrue(errorMessage.contains("org.apache.commons.dbutils.DbUtils.closeQuietly"),
                "System.err output should contain a stack trace element from DbUtils.closeQuietly, confirming handling.");

        } finally {
            // Cleanup: Restore the original System.err to avoid interfering with other tests
            System.setErr(originalErr);
        }
    }
}

package org.apache.commons.dbutils;

import static org.assertj.core.api.Assertions.assertThat;

import java.sql.Driver;
import java.sql.DriverManager;
import java.sql.SQLException;
import java.util.Enumeration;
import org.junit.jupiter.api.Test;

class DbUtilsH2DriverTest {

    @Test
    void testLoadH2DriverSuccessfully() throws SQLException {
        // Arrange
        final String h2DriverClassName = "org.h2.Driver";

        // Ensure the driver is not already registered from previous tests if any, 
        // though each test run should ideally be isolated.
        // This is a defensive measure to ensure deterministic behavior for this specific test.
        final Enumeration<Driver> initialDrivers = DriverManager.getDrivers();
        while (initialDrivers.hasMoreElements()) {
            Driver driver = initialDrivers.nextElement();
            if (driver.getClass().getName().equals(h2DriverClassName)) {
                DriverManager.deregisterDriver(driver);
            }
        }

        // Act
        final boolean loaded = DbUtils.loadDriver(h2DriverClassName);

        // Assert
        assertThat(loaded)
            .withFailMessage("Expected DbUtils.loadDriver() to return true for H2 driver")
            .isTrue();

        // Verify that the H2 driver is indeed registered with DriverManager
        boolean h2DriverFound = false;
        final Enumeration<Driver> registeredDrivers = DriverManager.getDrivers();
        while (registeredDrivers.hasMoreElements()) {
            Driver driver = registeredDrivers.nextElement();
            if (driver.getClass().getName().equals(h2DriverClassName)) {
                h2DriverFound = true;
                break;
            }
        }
        assertThat(h2DriverFound)
            .withFailMessage("Expected H2 driver to be found in DriverManager after loading")
            .isTrue();
    }
}

